import{_ as i,o as e,c as l,a}from"./app.afe75d95.js";const r={},d=a('<h1 id="oop" tabindex="-1"><a class="header-anchor" href="#oop" aria-hidden="true">#</a> OOP</h1><hr><blockquote><p>Object-oriented Programming</p></blockquote><h2 id="\u110C\u1165\u11AF\u110E\u1161\u110C\u1175\u1112\u1163\u11BC-vs-\u1100\u1162\u11A8\u110E\u1166\u110C\u1175\u1112\u1163\u11BC" tabindex="-1"><a class="header-anchor" href="#\u110C\u1165\u11AF\u110E\u1161\u110C\u1175\u1112\u1163\u11BC-vs-\u1100\u1162\u11A8\u110E\u1166\u110C\u1175\u1112\u1163\u11BC" aria-hidden="true">#</a> \uC808\uCC28\uC9C0\uD5A5 vs \uAC1D\uCCB4\uC9C0\uD5A5</h2><h3 id="\u110C\u1165\u11AF\u110E\u1161\u110C\u1175\u1112\u1163\u11BC" tabindex="-1"><a class="header-anchor" href="#\u110C\u1165\u11AF\u110E\u1161\u110C\u1175\u1112\u1163\u11BC" aria-hidden="true">#</a> \uC808\uCC28\uC9C0\uD5A5</h3><ul><li>\uB370\uC774\uD130\uC640 \uD504\uB85C\uC2DC\uC800\uB97C \uBCC4\uB3C4\uC758 \uBAA8\uB4C8\uC5D0 \uC704\uCE58\uC2DC\uD0A8\uB2E4.</li><li>\uC9C1\uAD00\uC801\uC73C\uB85C \uB370\uC774\uD130\uC758 \uD750\uB984\uC744 \uD30C\uC545\uD560 \uC218 \uC788\uB2E4.</li><li>\uC911\uAC04\uC5D0 \uB370\uC774\uD130 \uAC2F\uC218\uB098 \uD0C0\uC785\uC774 \uBCC0\uACBD\uB418\uBA74 \uC804\uCCB4 \uD750\uB984\uC5D0\uC11C \uBCC0\uACBD\uC774 \uC77C\uC5B4\uB098\uC57C \uD55C\uB2E4.</li><li>\uC808\uCC28\uC9C0\uD5A5\uC740 \uC694\uAD6C\uC0AC\uD56D\uC774 \uBCC0\uACBD\uB418\uC5C8\uC744\uB54C, \uB300\uC751\uD558\uB294 \uBE44\uC6A9\uC774 \uD06C\uB2E4.</li></ul><h3 id="\u1100\u1162\u11A8\u110E\u1166\u110C\u1175\u1112\u1163\u11BC" tabindex="-1"><a class="header-anchor" href="#\u1100\u1162\u11A8\u110E\u1166\u110C\u1175\u1112\u1163\u11BC" aria-hidden="true">#</a> \uAC1D\uCCB4\uC9C0\uD5A5</h3><ul><li>\uB370\uC774\uD130\uC640 \uD504\uB85C\uC2DC\uC800\uB97C \uAC1D\uCCB4\uC5D0 \uBAA8\uC740\uB2E4.</li><li>\uAC1D\uCCB4\uC5D0 \uD3EC\uD568\uB41C \uB370\uC774\uD130\uB294 \uD574\uB2F9 \uAC1D\uCCB4\uC758 \uD504\uB85C\uC2DC\uC800\uB9CC \uBCC0\uACBD\uD560 \uC218 \uC788\uB2E4.</li><li>\uC11C\uB85C \uB2E4\uB978 \uAC1D\uCCB4\uB294 \uB370\uC774\uD130\uB97C \uBCC0\uACBD\uD560 \uC218 \uC5C6\uC5B4\uC57C \uD55C\uB2E4.</li><li>\uAC1D\uCCB4 \uB0B4\uBD80 \uBCC0\uD654\uB97C \uC608\uCE21\uD558\uAE30 \uC26C\uC6B0\uBBC0\uB85C \uBCC0\uD654\uC5D0 \uB530\uB978 \uAC1C\uBC1C \uBE44\uC6A9\uC774 \uC801\uAC8C \uB4E0\uB2E4.</li></ul><p>--&gt; <code>\uCEA1\uC290\uD654</code>, <code>\uC0C1\uC18D</code>, <code>\uB2E4\uD615\uC131</code>, <code>\uCD94\uC0C1\uD654</code></p><blockquote><p>\uAC1D\uCCB4\uC9C0\uD5A5\uC758 \uD575\uC2EC\uC740 \uCEA1\uC290\uD654\uB97C \uC774\uC6A9\uD574 \uC758\uC874\uC131\uC744 \uC801\uC808\uD788 \uAD00\uB9AC\uD568\uC73C\uB85C\uC368 \uAC1D\uCCB4 \uAC04\uC758 \uACB0\uD569\uB3C4\uB97C \uB0AE\uCD94\uB294 \uAC83. \uC774\uB97C \uD1B5\uD574 \uC18C\uD504\uD2B8\uC6E8\uC5B4\uB97C \uAD6C\uC131\uD558\uB294 \uBAA8\uB4E0 \uAC1D\uCCB4\uB4E4\uC774 \uC790\uC728\uC801\uC73C\uB85C \uD589\uB3D9\uD558\uB294 \uC124\uACC4\uB97C \uBAA9\uD45C\uB85C \uD55C\uB2E4.</p></blockquote><h2 id="\u1100\u1162\u11A8\u110E\u1166" tabindex="-1"><a class="header-anchor" href="#\u1100\u1162\u11A8\u110E\u1166" aria-hidden="true">#</a> \uAC1D\uCCB4</h2><ul><li>\uD575\uC2EC : \uAE30\uB2A5 \uC81C\uACF5 <ul><li>\uC81C\uACF5\uD558\uB294 <strong>\uAE30\uB2A5</strong>\uC73C\uB85C \uAC1D\uCCB4\uB97C \uC815\uC758 (\uD589\uC704 / \uCC45\uC784 \uC911\uC2EC)</li><li>\uAC1D\uCCB4\uAC00 \uAC00\uC9C0\uACE0 \uC788\uB294 \uB370\uC774\uD130\uC640\uB294 \uBB34\uAD00</li></ul></li></ul><h3 id="\u110B\u1175\u11AB\u1110\u1165\u1111\u1166\u110B\u1175\u1109\u1173" tabindex="-1"><a class="header-anchor" href="#\u110B\u1175\u11AB\u1110\u1165\u1111\u1166\u110B\u1175\u1109\u1173" aria-hidden="true">#</a> \uC778\uD130\uD398\uC774\uC2A4</h3><ul><li>\uAC1D\uCCB4\uAC00 \uC81C\uACF5\uD558\uB294 \uAE30\uB2A5 \uBA85\uC138</li><li>\uBA54\uC11C\uB4DC \uC774\uB984, \uD30C\uB77C\uBBF8\uD130, \uB9AC\uD134 \uD0C0\uC785</li><li>\uD074\uB798\uC2A4\uAC00 \uAD6C\uD604</li><li>\uD074\uB798\uC2A4\uB97C \uC2E4\uC81C \uBA54\uBAA8\uB9AC\uC5D0 \uC62C\uB9AC\uBA74 \uC778\uC2A4\uD134\uC2A4</li></ul><h3 id="\u1106\u1166\u1109\u1175\u110C\u1175" tabindex="-1"><a class="header-anchor" href="#\u1106\u1166\u1109\u1175\u110C\u1175" aria-hidden="true">#</a> \uBA54\uC2DC\uC9C0</h3><ul><li>\uBA54\uC2DC\uC9C0 \uC804\uB2EC\uC740 \uAC1D\uCCB4\uC5D0 \uAE30\uB2A5 \uC2E4\uD589\uC744 \uC694\uCCAD\uD558\uB294 \uAC83</li><li>\uC77C\uBC18\uC801\uC778 \uC5B8\uC5B4\uC5D0\uC11C \uBA54\uC11C\uB4DC \uD638\uCD9C\uB85C \uAD6C\uD604</li></ul><h2 id="\u110B\u1167\u11A8\u1112\u1161\u11AF\u1100\u116A-\u110E\u1162\u11A8\u110B\u1175\u11B7-\u1100\u1173\u1105\u1175\u1100\u1169-\u1112\u1167\u11B8\u1105\u1167\u11A8" tabindex="-1"><a class="header-anchor" href="#\u110B\u1167\u11A8\u1112\u1161\u11AF\u1100\u116A-\u110E\u1162\u11A8\u110B\u1175\u11B7-\u1100\u1173\u1105\u1175\u1100\u1169-\u1112\u1167\u11B8\u1105\u1167\u11A8" aria-hidden="true">#</a> \uC5ED\uD560\uACFC \uCC45\uC784, \uADF8\uB9AC\uACE0 \uD611\uB825</h2><h3 id="\u1112\u1167\u11B8\u1105\u1167\u11A8" tabindex="-1"><a class="header-anchor" href="#\u1112\u1167\u11B8\u1105\u1167\u11A8" aria-hidden="true">#</a> \uD611\uB825</h3><ul><li>\uC5B4\uB5A4 \uAC1D\uCCB4\uAC00 \uB2E4\uB978 \uAC1D\uCCB4\uC5D0 \uBB34\uC5B8\uAC00 \uC694\uCCAD</li><li>\uD55C \uAC1D\uCCB4\uB294 \uC5B4\uB5A4 \uAC83\uC774 \uD544\uC694\uD560 \uB54C \uB2E4\uB978 \uAC1D\uCCB4\uC5D0\uAC8C \uC804\uC801\uC73C\uB85C \uC704\uC784\uD558\uAC70\uB098 \uC11C\uB85C \uD611\uB825\uD55C\uB2E4.</li><li>\uC989, \uB450 \uAC1D\uCCB4\uAC00 \uC0C1\uD638\uC791\uC6A9\uC744 \uD1B5\uD574 \uB354 \uD070 \uCC45\uC784\uC744 \uC218\uD589\uD558\uB294 \uAC83\uC774\uB2E4.</li><li><strong>\uD611\uB825\uC774 \uC124\uACC4\uB97C \uC704\uD55C \uBB38\uB9E5\uC744 \uACB0\uC815</strong></li><li><em>\uC0C1\uD0DC</em>\uB294 \uAC1D\uCCB4\uAC00 \uD589\uB3D9\uD558\uB294 \uB370 \uD544\uC694\uD55C <strong>\uC815\uBCF4</strong>\uC5D0 \uC758\uD574 \uACB0\uC815\uB418\uACE0, <em>\uD589\uB3D9</em>\uC740 \uD611\uB825 \uC548\uC5D0\uC11C <strong>\uBA54\uC2DC\uC9C0</strong>\uB85C \uACB0\uC815\uB41C\uB2E4.</li><li>\uB530\uB77C\uC11C \uD611\uB825\uC740 \uAC1D\uCCB4 \uC124\uACC4\uC5D0 \uD544\uC694\uD55C \uBB38\uB9E5(context) \uC81C\uACF5</li></ul><h3 id="\u110E\u1162\u11A8\u110B\u1175\u11B7" tabindex="-1"><a class="header-anchor" href="#\u110E\u1162\u11A8\u110B\u1175\u11B7" aria-hidden="true">#</a> \uCC45\uC784</h3><ul><li>\uAC1D\uCCB4\uC5D0 \uC758\uD574 \uC815\uC758\uB418\uB294 \uC751\uC9D1\uB3C4 \uC788\uB294 \uD589\uC704 \uC9D1\uD569, \uAC1D\uCCB4\uAC00 \uC720\uC9C0\uD574\uC57C \uD558\uB294 \uC815\uBCF4\uC640 \uC218\uD589\uD560 \uC218 \uC788\uB294 \uD589\uB3D9\uC5D0 \uB300\uD574 \uAC1C\uB7B5\uC801\uC73C\uB85C \uC11C\uC220\uD55C \uBB38\uC7A5</li><li>\uCC45\uC784\uC740 \uBA54\uC2DC\uC9C0\uBCF4\uB2E4 \uCD94\uC0C1\uC801\uC774\uACE0 \uAC1C\uB150\uC801\uC73C\uB85C\uB3C4 \uB354 \uD06C\uB2E4.</li><li>\uAC1D\uCCB4 \uC9C0\uD5A5 \uC124\uACC4\uC5D0\uC11C \uCC45\uC784\uC744 \uC5BC\uB9C8\uB098 \uC801\uC808\uD55C \uAC1D\uCCB4\uC5D0\uAC8C \uD560\uB2F9\uD558\uB290\uB0D0\uAC00 \uC124\uACC4\uC758 \uC804\uCCB4\uC801\uC778 \uD488\uC9C8\uC744 \uACB0\uC815\uD55C\uB2E4.</li></ul><h4 id="\u110E\u1162\u11A8\u110B\u1175\u11B7-\u110C\u116E\u1103\u1169-\u1109\u1165\u11AF\u1100\u1168" tabindex="-1"><a class="header-anchor" href="#\u110E\u1162\u11A8\u110B\u1175\u11B7-\u110C\u116E\u1103\u1169-\u1109\u1165\u11AF\u1100\u1168" aria-hidden="true">#</a> \uCC45\uC784 \uC8FC\uB3C4 \uC124\uACC4</h4><ol><li>\uC2DC\uC2A4\uD15C\uC774 \uC0AC\uC6A9\uC790\uC5D0\uAC8C \uC81C\uACF5\uD574\uC57C \uD558\uB294 \uAE30\uB2A5\uC778 \uC2DC\uC2A4\uD15C \uCC45\uC784 \uD30C\uC545</li><li>\uC2DC\uC2A4\uD15C\uC774 \uCC45\uC784\uC744 \uB354 \uC791\uC740 \uCC45\uC784\uC73C\uB85C \uBD84\uD560</li><li>\uBD84\uD560\uB41C \uCC45\uC784\uC744 \uC218\uD589\uD560 \uC218 \uC788\uB294 \uC801\uC808\uD55C \uAC1D\uCCB4 \uB610\uB294 \uC5ED\uD560\uC744 \uCC3E\uC544 \uCC45\uC784\uC744 \uD560\uB2F9</li><li>\uAC1D\uCCB4\uAC00 \uCC45\uC784\uC744 \uC218\uD589\uD558\uB294 \uB3C4\uC911 \uB2E4\uB978 \uAC1D\uCCB4\uC758 \uB3C4\uC6C0\uC774 \uD544\uC694\uD55C \uACBD\uC6B0 \uC774\uB97C \uCC45\uC784\uC9C8 \uC801\uC808\uD55C \uAC1D\uCCB4 \uB610\uB294 \uC5ED\uD560 \uD30C\uC545</li><li>\uD574\uB2F9 \uAC1D\uCCB4 \uB610\uB294 \uC5ED\uD560\uC5D0 \uCC45\uC784 \uD560\uB2F9\uC73C\uB85C \uB450 \uAC1D\uCCB4\uAC00 \uD611\uB825\uD558\uB3C4\uB85D \uD568</li></ol><h4 id="\u1106\u1166\u1109\u1175\u110C\u1175\u1100\u1161-\u1100\u1162\u11A8\u110E\u1166\u1105\u1173\u11AF-\u1100\u1167\u11AF\u110C\u1165\u11BC" tabindex="-1"><a class="header-anchor" href="#\u1106\u1166\u1109\u1175\u110C\u1175\u1100\u1161-\u1100\u1162\u11A8\u110E\u1166\u1105\u1173\u11AF-\u1100\u1167\u11AF\u110C\u1165\u11BC" aria-hidden="true">#</a> \uBA54\uC2DC\uC9C0\uAC00 \uAC1D\uCCB4\uB97C \uACB0\uC815</h4><ul><li>\uAC1D\uCCB4\uAC00 \uCD5C\uC18C\uD55C\uC758 \uC778\uD130\uD398\uC774\uC2A4\uB97C \uAC00\uC9C8 \uC218 \uC788\uAC8C \uB41C\uB2E4.</li><li>\uAC1D\uCCB4\uB294 \uCDA9\uBD84\uD788 \uCD94\uC0C1\uC801\uC778 \uC778\uD130\uD398\uC774\uC2A4\uB97C \uAC00\uC9C8 \uC218 \uC788\uAC8C \uB41C\uB2E4.</li><li>\uAC1D\uCCB4\uAC00 \uCDA9\uBD84\uD788 \uCD94\uC0C1\uC801\uC774\uBA74\uC11C \uBBF8\uB2C8\uBA40\uB9AC\uC998\uC744 \uB530\uB974\uB294 \uC778\uD130\uD398\uC774\uC2A4\uB97C \uAC00\uC9C0\uAC8C \uD558\uACE0 \uC2F6\uB2E4\uBA74 \uBA54\uC2DC\uC9C0\uAC00 \uAC1D\uCCB4\uB97C \uC120\uD0DD\uD558\uB3C4\uB85D \uD55C\uB2E4.</li></ul><h3 id="\u110B\u1167\u11A8\u1112\u1161\u11AF" tabindex="-1"><a class="header-anchor" href="#\u110B\u1167\u11A8\u1112\u1161\u11AF" aria-hidden="true">#</a> \uC5ED\uD560</h3><ul><li>\uAC1D\uCCB4\uAC00 \uC5B4\uB5A4 \uD2B9\uC815\uD55C \uD611\uB825 \uC548\uC5D0\uC11C \uC218\uD589\uD558\uB294 \uCC45\uC784\uC758 \uC9D1\uD569</li><li>\uD611\uB825\uC774\uB77C\uB294 \uBB38\uB9E5 \uC548\uC5D0\uC11C \uD544\uC694\uD55C \uCC45\uC784\uC744 \uCD94\uB838\uB2E4\uBA74, \uD574\uB2F9 \uCC45\uC784\uC744 \uAC00\uC9C0\uACE0 \uC788\uC5B4\uC57C \uD560 \uC5ED\uD560\uC774 \uBB34\uC5C7\uC778\uC9C0 \uAC1C\uB150\uC744 \uBF51\uC544\uB0B4\uACE0 \uADF8 \uB2E4\uC74C\uC5D0 \uC5ED\uD560\uC5D0 \uB9DE\uB294 \uC774\uB984\uC744 \uBD80\uC5EC\uD558\uC5EC \uD074\uB798\uC2A4\uB85C \uB9CC\uB4E0\uB2E4.</li></ul><h4 id="\u110B\u1172\u110B\u1167\u11AB\u1112\u1161\u1100\u1169-\u110C\u1162\u1109\u1161\u110B\u116D\u11BC-\u1100\u1161\u1102\u1173\u11BC\u1112\u1161\u11AB-\u1112\u1167\u11B8\u1105\u1167\u11A8" tabindex="-1"><a class="header-anchor" href="#\u110B\u1172\u110B\u1167\u11AB\u1112\u1161\u1100\u1169-\u110C\u1162\u1109\u1161\u110B\u116D\u11BC-\u1100\u1161\u1102\u1173\u11BC\u1112\u1161\u11AB-\u1112\u1167\u11B8\u1105\u1167\u11A8" aria-hidden="true">#</a> \uC720\uC5F0\uD558\uACE0 \uC7AC\uC0AC\uC6A9 \uAC00\uB2A5\uD55C \uD611\uB825</h4><ul><li>\uC5ED\uD560\uC744 \uD1B5\uD574 \uC720\uC5F0\uD558\uACE0 <strong>\uC7AC\uC0AC\uC6A9 \uAC00\uB2A5\uD55C \uD611\uB825</strong>\uC744 \uC5BB\uC744 \uC218 \uC788\uB2E4.</li><li>\uC5ED\uD560\uC5D0 \uC9D1\uC911\uD558\uBA74 \uCD94\uC0C1\uC801\uC778 \uB124\uC774\uBC0D\uC744 \uAC00\uC838\uB3C4 \uBB38\uB9E5\uC740 \uC720\uC9C0\uAC00 \uB418\uACE0, \uBE44\uC2B7\uD55C \uAD6C\uD604\uC758 \uB2E4\uB978 \uAC1D\uCCB4\uB97C \uCD94\uAC00\uD558\uB294\uB370 \uD070 \uBE44\uC6A9\uC774 \uB4E4\uC9C0 \uC54A\uB294\uB2E4.</li><li>\uAC1D\uCCB4\uC5D0\uAC8C \uC911\uC694\uD55C \uAC83\uC774 \uD589\uB3D9\uC784\uC740 \uBCC0\uD568\uC774 \uC5C6\uB2E4. \uC5ED\uD560\uC740 \uB3D9\uC77C\uD55C \uD611\uB825\uC744 <strong>\uC218\uD589\uD558\uB294</strong> \uAC1D\uCCB4\uB4E4\uC744 \uCD94\uC0C1\uD654\uD560 \uC218 \uC788\uB2E4.</li></ul><blockquote><p>\uAC1D\uCCB4\uC9C0\uD5A5 \uD504\uB85C\uADF8\uB798\uBC0D\uC5D0\uC11C\uB294 \uAC1D\uCCB4\uB294 \uD558\uB098\uC758 <em>\uCC45\uC784</em>\uC744 \uAC00\uC9C4 <em>\uC5ED\uD560</em>\uB85C\uC11C <em>\uD611\uB825</em>\uC5D0 \uCC38\uC5EC\uD558\uC5EC \uC18C\uD504\uD2B8\uC6E8\uC5B4\uC758 \uBAA9\uC801\uC744 \uB2EC\uC131 \uD611\uB825 &gt; \uCC45\uC784 &gt; \uC5ED\uD560 &gt; \uAC1D\uCCB4 &gt; \uD074\uB798\uC2A4</p></blockquote><h2 id="\u1100\u1167\u11AF\u1112\u1161\u11B8\u1103\u1169\u110B\u116A-\u110B\u1173\u11BC\u110C\u1175\u11B8\u1103\u1169" tabindex="-1"><a class="header-anchor" href="#\u1100\u1167\u11AF\u1112\u1161\u11B8\u1103\u1169\u110B\u116A-\u110B\u1173\u11BC\u110C\u1175\u11B8\u1103\u1169" aria-hidden="true">#</a> \uACB0\uD569\uB3C4\uC640 \uC751\uC9D1\uB3C4</h2><h3 id="\u1100\u1167\u11AF\u1112\u1161\u11B8\u1103\u1169" tabindex="-1"><a class="header-anchor" href="#\u1100\u1167\u11AF\u1112\u1161\u11B8\u1103\u1169" aria-hidden="true">#</a> \uACB0\uD569\uB3C4</h3><ul><li>\uACB0\uD569\uB3C4\uB294 <em>\uC758\uC874\uC131\uC758 \uC815\uB3C4</em>\uB97C \uB098\uD0C0\uB0B4\uBA70 \uB2E4\uB978 \uBAA8\uB4C8\uC5D0 \uC5BC\uB9C8\uB098 \uB9CE\uC740 \uC9C0\uC2DD\uC744 \uAC16\uACE0 \uC788\uB294\uC9C0\uB97C \uB098\uD0C0\uB0B8\uB2E4.</li><li>\uC5B4\uB5A4 \uBAA8\uB4C8\uC774 \uB2E4\uB978 \uBAA8\uB4C8\uC5D0 \uB300\uD574 <em>\uC790\uC138\uD55C \uBD80\uBD84</em>\uC744 \uC54C\uACE0 \uC788\uB2E4\uBA74 \uB450 \uBAA8\uB4C8\uC740 <em>\uB192\uC740 \uACB0\uD569\uB3C4</em>\uB97C \uAC00\uC9C4\uB2E4.</li><li>\uC5B4\uB5A4 \uBAA8\uB4C8\uC774 \uB2E4\uB978 \uBAA8\uB4C8\uC5D0 \uB300\uD574 <em>\uD544\uC694\uD55C \uC9C0\uC2DD</em>\uB9CC\uC744 \uC54C\uACE0 \uC788\uB2E4\uBA74 \uB450 \uBAA8\uB4C8\uC740 <em>\uB0AE\uC740 \uACB0\uD569\uB3C4</em>\uB97C \uAC00\uC9C4\uB2E4.</li><li>\uACB0\uD569\uB3C4\uB294 <code>\uD611\uB825\uC5D0 \uD544\uC694\uD55C \uC801\uC808\uD55C \uC218\uC900\uC758 \uAD00\uACC4\uB9CC\uC744 \uC720\uC9C0</code>\uD558\uB294 \uAC83\uC774 \uC911\uC694</li><li><strong>\uD55C \uBAA8\uB4C8\uC774 \uBCC0\uACBD\uB418\uAE30 \uC704\uD574 \uB2E4\uB978 \uBAA8\uB4C8\uC758 \uBCC0\uACBD\uC744 \uC694\uAD6C\uD558\uB294 \uC815\uB3C4\uB85C \uCE21\uC815</strong><ul><li>\uB0B4\uBD80 \uAD6C\uD604\uC744 \uBCC0\uACBD\uD588\uC744 \uB54C \uB2E4\uB978 \uBAA8\uB4C8\uC5D0 \uC601\uD5A5\uC744 \uBBF8\uCE58\uB294 \uACBD\uC6B0 <code>\uB192\uC740 \uACB0\uD569\uB3C4</code>\uB97C \uAC00\uC9D0</li><li><strong>Public Interface</strong>\uB97C \uC218\uC815\uD588\uC744 \uB54C\uB9CC \uB2E4\uB978 \uBAA8\uB4C8\uC5D0 \uC601\uD5A5\uC744 \uBBF8\uCE58\uB294 \uACBD\uC6B0 <code>\uB0AE\uC740 \uACB0\uD569\uB3C4</code>\uB97C \uAC00\uC9D0</li><li>\uB530\uB77C\uC11C \uAD6C\uD604\uC774 \uC544\uB2CC \uC778\uD130\uD398\uC774\uC2A4\uC5D0 \uC758\uC874\uD558\uB3C4\uB85D \uCF54\uB4DC\uB97C \uC791\uC131\uD574\uC57C \uB0AE\uC740 \uACB0\uD569\uB3C4\uB97C \uC5BB\uC744 \uC218 \uC788\uB2E4.</li></ul></li></ul><h3 id="\u110B\u1173\u11BC\u110C\u1175\u11B8\u1103\u1169" tabindex="-1"><a class="header-anchor" href="#\u110B\u1173\u11BC\u110C\u1175\u11B8\u1103\u1169" aria-hidden="true">#</a> \uC751\uC9D1\uB3C4</h3><ul><li>\uBAA8\uB4C8\uC5D0 \uD3EC\uD568\uB41C \uB0B4\uBD80 \uC694\uC18C\uB4E4\uC774 \uC5F0\uAD00\uB3FC \uC788\uB294 \uC815\uB3C4</li><li>\uBAA8\uB4C8 \uB0B4 \uC694\uC18C\uB4E4\uC774 \uD558\uB098\uC758 \uBAA9\uC801\uC744 \uC704\uD574 \uAE34\uBC00\uD558\uAC8C \uD611\uB825\uD55C\uB2E4\uBA74 \uADF8 \uBAA8\uB4C8\uC740 \uB192\uC740 \uC751\uC9D1\uB3C4\uB97C \uAC00\uC9D0</li><li>\uBAA8\uB4C8 \uB0B4\uC758 \uC694\uC18C\uB4E4\uC774 \uC11C\uB85C \uB2E4\uB978 \uBAA9\uC801\uC744 \uCD94\uAD6C\uD55C\uB2E4\uBA74 \uADF8 \uBAA8\uB4C8\uC740 \uB0AE\uC740 \uC751\uC9D1\uB3C4\uB97C \uAC00\uC9D0</li><li>\uAC1D\uCCB4\uC9C0\uD5A5 \uAD00\uC810\uC5D0\uC11C\uC758 \uC751\uC9D1\uB3C4\uB294 \uAC1D\uCCB4/\uD074\uB798\uC2A4\uC5D0 \uC5BC\uB9C8\uB098 <code>\uAD00\uB828\uC774 \uB192\uC740 \uCC45\uC784\uB4E4\uC744 \uD560\uB2F9\uD588\uB294\uC9C0</code>\uB97C \uB098\uD0C0\uB0B8\uB2E4.</li></ul><h2 id="\u110C\u1169\u11C2\u110B\u1173\u11AB-\u1109\u1165\u11AF\u1100\u1168" tabindex="-1"><a class="header-anchor" href="#\u110C\u1169\u11C2\u110B\u1173\u11AB-\u1109\u1165\u11AF\u1100\u1168" aria-hidden="true">#</a> \uC88B\uC740 \uC124\uACC4</h2><ul><li>\uC694\uAD6C\uB418\uB294 \uAE30\uB2A5\uC758 \uC628\uC804\uD55C \uC218\uD589\uC744 \uC644\uC131\uC2DC\uD0B4\uC740 \uBB3C\uB860, \uCD94\uAC00\uB418\uB294 \uBCC0\uACBD\uC5D0\uB3C4 \uC720\uC5F0\uD558\uAC8C \uB300\uC751 \uAC00\uB2A5\uD55C \uC124\uACC4</li><li>\uAC1D\uCCB4\uC9C0\uD5A5 \uD504\uB85C\uADF8\uB798\uBC0D\uC740 <em>\uAC1D\uCCB4 \uC0AC\uC774 \uC758\uC874\uC131</em>\uC744 \uD6A8\uC728\uC801\uC73C\uB85C \uD1B5\uC81C\uD560 \uC218 \uC788\uB294 \uB2E4\uC591\uD55C \uBC29\uBC95\uC744 \uC81C\uACF5\uD568\uC740 \uBB3C\uB860 \uC88B\uC740 \uC124\uACC4\uB97C \uB3C4\uC640\uC8FC\uB294 \uD558\uB098\uC758 \uC88B\uC740 \uB3C4\uAD6C</li><li>\uC62C\uBC14\uB978 \uAC1D\uCCB4\uC5D0 \uC62C\uBC14\uB978 \uCC45\uC784\uC744 \uD560\uB2F9\uD558\uBA74\uC11C <strong>\uB0AE\uC740 \uACB0\uD569\uB3C4\uC640 \uB192\uC740 \uC751\uC9D1\uB3C4</strong>\uB97C \uAC00\uC9C4 \uAD6C\uC870\uB97C \uB9CC\uB4DC\uB294 \uD589\uC704</li></ul>',37),h=[d];function t(n,o){return e(),l("div",null,h)}var s=i(r,[["render",t],["__file","OOP.html.vue"]]);export{s as default};
